import React from 'react';
import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonButton, IonIcon, IonFooter, IonProgressBar } from '@ionic/react';
import { settingsOutline, personCircleOutline } from 'ionicons/icons';
import './Home.css';
// import './AA.js';

const Home: React.FC = () => {
  // console.log(AA);
  return (
    <IonPage>
      <IonContent
        scrollEvents={false}
        onIonScrollStart={() => {}}
        onIonScroll={() => {}}
        onIonScrollEnd={() => {}}>
          <IonToolbar>
        {/* <IonButtons slot="start" className="largeButton"> */}
          <IonButton routerLink="/profile" fill="clear" size="large" color="light">    
            <IonIcon icon={personCircleOutline} />      
          </IonButton>
        {/* </IonButtons> */}
        {/* <IonButtons slot="end" className="largeButton"> */}
          <IonButton className="right" routerLink="/settings" fill="clear" size="large" color="light">    
            <IonIcon icon={settingsOutline} />
          </IonButton>
        {/* </IonButtons> */}
        </IonToolbar>
          <h1>Main Content1</h1>
          {/* <div slot="fixed">
            <h1>{ text }</h1>
          </div> */}
          <IonProgressBar className="song-bar" value={0.72}></IonProgressBar>
      </IonContent>
      <IonFooter className="ion-no-border footer">
        <IonToolbar>
          <IonTitle>Footer - No Border</IonTitle>
        </IonToolbar>
    </IonFooter>
    </IonPage>
  );
};

export default Home;
